package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 23/05/16. */public class UserPersonalInformation {    private String firstName;    private String lastName;    private String addressOne;    private String addressTwo;    private String city;    private String postCode;    public String getFirstName() {        return firstName;    }    public void setFirstName(String firstName) {        this.firstName = firstName;    }    public String getLastName() {        return lastName;    }    public void setLastName(String lastName) {        this.lastName = lastName;    }    public String getAddressOne() {        return addressOne;    }    public void setAddressOne(String addressOne) {        this.addressOne = addressOne;    }    public String getAddressTwo() {        return addressTwo;    }    public void setAddressTwo(String addressTwo) {        this.addressTwo = addressTwo;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }    public String getPostCode() {        return postCode;    }    public void setPostCode(String postCode) {        this.postCode = postCode;    }}